INSERT INTO `articles` (`id`, `category_id`, `title`, `slug`, `content`, `image`, `status`, `date`, `featured`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 1, 'Usulkan 10 Raperda, Satu Diantaranya Penanganan Anak', 'usulkan-10-raperda-satu-diantaranya-penanganan-anak', '<p>Pandangan Fraksi DPRD atas 10 Raperda</p>\r\n\r\n<p>PONTIANAK - Tujuh fraksi DPRD Kota Pontianak menyampaikan pandangan terhadap 10 Rancangan Peraturan Daerah (Raperda). Wali Kota Pontianak Edi Rusdi Kamtono menyebut, dari penyampaian tersebut ada beberapa masukan dari fraksi-fraksi. Raperda tersebut merupakan inisiasi Pemerintah Kota (Pemkot) Pontianak dan satu inisiasi DPRD Kota Pontianak. Satu diantaranya adalah Raperda penanganan anak. Raperda itu disusun untuk memenuhi persyaratan yang diminta dari kementerian terkait. &quot;Untuk melengkapi pelayanan dan kinerja Pemerintah Kota (Pemkot) Pontianak,&quot; ujarnya usai mendengarkan penyampaian pandangan fraksi DPRD Kota Pontianak di Ruang Rapat Paripurna, Rabu (14/4/2021).</p>', , 'PUBLISHED', '2021-04-15', 1, '2021-04-14 20:29:34', '2021-04-15 20:34:42', NULL);
INSERT INTO `articles` (`id`, `category_id`, `title`, `slug`, `content`, `image`, `status`, `date`, `featured`, `created_at`, `updated_at`, `deleted_at`) VALUES
(2, 1, 'Puasa Momentum Ujian Kesabaran di Tengah Pandemi', 'puasa-momentum-ujian-kesabaran-di-tengah-pandemi', '<p>Wali Kota Edi Kamtono : Ketaatan Beribadah Bagian dari Nilai Kesabaran</p>\r\n\r\n<p>PONTIANAK - Puasa Ramadan menjadi momentum menguji kesabaran umat Islam dalam menghadapi pandemi Covid-19. Betapa tidak, hampir semua aspek kehidupan terdampak akibat pandemi. Wali Kota Pontianak Edi Rusdi Kamtono mengatakan bahwa ketaatan beribadah menjadi bagian dari nilai kesabaran manusia. Selain itu, kesabaran juga tidak terlepas dari bagaimana menghadapi musibah dari Tuhan seperti halnya pandemi Covid-19. &quot;Oleh sebab itu apabila kita bisa melewati dan bersabar menahan diri, semua akan dilewati dengan baik. Semoga pandemi ini segera berakhir dari muka bumi,&quot; ujarnya saat menyampaikan tausiyah singkat sebelum salat tarawih berjamaah di Masjid Al Ikhlas Jalan H Agus Salim Kelurahan Benua Melayu Darat Kecamatan Pontianak Selatan, Selasa (13/4/2021).</p>', , 'PUBLISHED', '2021-04-15', 0, '2021-04-15 00:12:16', '2021-04-15 20:34:14', NULL);

