INSERT INTO `pages` (`id`, `template`, `name`, `title`, `slug`, `content`, `extras`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'about_us', 'Tentang PPID', 'Tentang PPID', 'tentang-ppid', '<p>Pedoman Pengelolaan Pelayanan Informasi Dan Dokumentasi Publik Di Lingkungan Pemerintah Kota Pontianak diatur kembali dalam Peraturan Walikota Pontianak Nomor 49 Tahun 2018 yang ditetapkan pada tanggal 2 Agustus 2018.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Tugas PPID</strong></p>\r\n\r\n<ol>\r\n	<li>mengkoordinasikan penyimpanan dan pendokumentasian seluruh informasi publik;</li>\r\n	<li>mengkoordinasikan penyediaan dan pelayanan seluruh informasi publik di bawah penguasaan masing-masing yang dapat diakses oleh publik;</li>\r\n	<li>menjaga kerahasiaan informasi yang dikecualikan kepada masyarakat dan/atau pemohon informasi publik;</li>\r\n	<li>menjamin keakuratan informasi yang diberikan kepada masyarakat dan/atau pemohon informasi publik</li>\r\n</ol>\r\n\r\n<p><img alt=\"\" src=\"http://localhost:1234/bpppid/public/uploads/1600138760-struktur-organisasi-kominfo-2020-3x.jpg\" style=\"height:567px; width:778px\" /></p>', NULL, '2021-04-09 00:32:53', '2021-05-03 19:09:34', NULL),
(2, 'about_us', 'Visi & Misi', 'Visi & Misi', 'visi-misi', '<p><strong>VISI</strong><br />\r\nTerwujudnya pelayanan informasi yang transparan dan akuntabel untuk memenuhi hak pemohon informasi sesuai dengan ketentuan peraturan perundang-undangan</p>\r\n\r\n<p><strong>MISI</strong></p>\r\n\r\n<p>1.Meningkatkan pengelolaan dan pelayanan informasi yang berkualitas<br />\r\n2.Membangun dan mengembangkan system penyediaan dan layanan informasi<br />\r\n3.Meningkatkan kopetensi sumberdaya manusia</p>', NULL, '2021-05-03 18:38:02', '2021-05-03 18:38:02', NULL),
(3, 'about_us', 'Maklumat', 'Maklumat', 'maklumat', '<p><strong>Maklumat pelayanan Informasi Publik</strong></p>\r\n\r\n<p>Kami berupaya memberikan pelayanan informasi public dengan sungguh-sungguh untuk dapat :</p>\r\n\r\n<ol>\r\n	<li>Memberikan Pelayanan Informasi Kepada Setiap Pemohon Informasi Sesuai Dengan Prosedur Dan Pedoman Pelayanan Informasi Sebagaimana Undang-Undang Dan Peraturan Yang Berlaku.</li>\r\n	<li>Memberikan kemudahan dalam mendapat informasi</li>\r\n	<li>Menyediakan daftar informasi publik untuk informasi yang wajib disediakan dan diumumkan.</li>\r\n</ol>', NULL, '2021-05-03 18:44:30', '2021-05-03 18:44:30', NULL),
(4, 'about_us', 'Keterbukaan Informasi', 'Keterbukaan Informasi', 'keterbukaan-informasi', '<p><strong>Latar Belakang</strong></p>\r\n\r\n<p>Informasi selain merupakan kebutuhan pokok setiap orang untuk pengembangan diri dan sosial, juga merupakan bagian penting ketahanan nasional. Hak untuk memperoleh informasi adalah hak asasi manusia. Keterbukaan informasi publik adalah salah satu ciri penting negara demokratis yang menjunjung tinggi kedaulat an rakyat yang pada dasarnya bertujuan untuk mewujudkan&nbsp;<em>good governance</em>. Pengelolaan informasi publik yang baik merupakan salah satu upaya untuk mengembangkan masyarakat informasi.</p>\r\n\r\n<p>Undang-Undang Republik Indonesia No. 14 Tahun 2008 Tentang Keterbukaan Informasi Publik yang diundangkan pada tanggal 30 April 2008 mengisyaratkan bahwa penyelenggaraan negara harus dilakukan secara terbuka atau transparan. Setiap orang dijamin haknya untuk memperoleh informasi publik sesuai dengan peraturan perundang-undangan. Ini antara lain bertujuan agar penyelenggaraan negara dapat diawasi oleh publik dan keterlibatan masyarakat dalam proses penentuan kebijakan publik semakin tinggi. Keterlibatan tersebut pada akhirnya akan menghasilkan penyeleggaraan negara yang lebih berkualitas. Partisipasi seperti itu menghendaki adanya jaminan terhadap keterbukaan informasi publik.</p>\r\n\r\n<p>Undang-undang tentang Keterbukaan Informasi Publik menjadi landasan hukum yang mengatur antara lain tentang:</p>\r\n\r\n<ol>\r\n	<li>Hak setiap orang untuk memperoleh informasi publik</li>\r\n	<li>Kewajiban setiap badan publik menyediakan dan melayani permintaan informasi secara cepat, tepat waktu, biaya ringan/proporsional, dan dengan cara sederhana</li>\r\n	<li>Informasi dengan pengecualian yang bersifat ketat dan terbatas</li>\r\n	<li>Kewajiban badan publik untuk membenahi sistem dokumentasi dan pelayanan informasi.</li>\r\n</ol>\r\n\r\n<p><strong><a name=\"dasarhukum\"></a>Dasar Hukum</strong></p>\r\n\r\n<p>Peraturan-perundangan yang dijadikan sebagai dasar hukum dalam pengelolaan pelayanan informasi dan dokumentasi di lingkungan Pemerintah Provinsi Kalimantan Barat&nbsp;adalah antara lain sebagai berikut:</p>\r\n\r\n<ol>\r\n	<li>Undang-undang Dasar Negara Republik Indonesia Tahun 1945;</li>\r\n	<li>Undang-undang Republik Indonesia No. 14 Tahun 2008 Tentang Keterbukaan Informasi Publik;</li>\r\n	<li>Undang-undang Republik Indonesia No. 25 Tahun 2009 Tentang Pelayanan Publik;</li>\r\n	<li>Undang-undang Republik Indonesia No. 43 tahun 2009 tentang Kearsipan;</li>\r\n	<li>Peraturan Pemerintah Republik Indonesia No. 61 Tahun 2010 Tentang Pelaksanaan Undang-undang No. 14 Tahun 2008 Tentang Keterbukaan Informasi Publik;</li>\r\n	<li>Peraturan Pemerintah Republik Indonesia No. 96 Tahun 2012 Tentang Pelaksanaan Undang-undang No. 25 Tahun 2009 Tentang Pelayanan Publik;</li>\r\n	<li>Peraturan Pemerintah Republik Indonesia No. 28 Tahun 2012 Tentang Pelaksanaan Undang-undang No. 43 Tahun 2009 Tentang Kearsipan</li>\r\n	<li>Peraturan Menteri Dalam Negeri No. 3&nbsp;Tahun 2017&nbsp;Tentang Pedoman Pengelolaan Pelayanan Informasi dan Dokumentasi Kementerian Dalam Negeri dan Pemerintahan Daerah;</li>\r\n	<li>Peraturan Komisi Informasi No. 1 Tahun 2010 Tentang Standar Layanan Informasi Publik;</li>\r\n	<li>Peraturan Komisi Informasi No. 1 Tahun 2013 Tentang Prosedur Penyelesaian Sengketa Informasi Publik;</li>\r\n	<li>Peraturan Gubernur Nomor 22 Tahun 2016 tentang Pedoman Pengelolaan Pelayanan Informasi Publik dan Dokumentasi di Lingkungan Pemerintah Provinsi Kalimantan Barat;</li>\r\n	<li>Keputusan Gubernur Kalimantan Barat Nomor 163/HUMPRO/2017 Tentang Penunjukan Pejabat Pengelolaan Layanan Informasi dan Dokumentasi di Lingkungan Pemerintah Provinsi Kalimantan Barat.</li>\r\n</ol>\r\n\r\n<p><strong><a name=\"PengertianInformasiPublik\"></a>Pengertian Informasi Publik</strong></p>\r\n\r\n<p>Informasi publik adalah informasi yang dihasilkan,disimpan, dikelola, dikirim, dan/atau diterima oleh suatu badan publik yang berkaitan dengan penyelenggara dan penyelenggaraan negara dan/atau badan publik lainnya.</p>\r\n\r\n<p><strong><a name=\"PengertianBadanPublik\"></a>Pengertian Badan Publik</strong></p>\r\n\r\n<p>Badan publik adalah lembaga eksekutif, legislatif, yudikatif, dan organisasi non pemerintah yang sebagian atau seluruh dananya bersumber dari Anggaran Pendapatan dan Belanja Negara (APBN) dan/atau Anggaran Pendapatan dan Belanja Daerah (APBD), sumbangan masyarakat, dan/atau luar negeri.</p>\r\n\r\n<p><strong><a name=\"InformasiYangDikecualikan\"></a>Informasi yang Dikecualikan</strong></p>\r\n\r\n<p>Informasi yang dikecualikan antara lain adalah</p>\r\n\r\n<ol>\r\n	<li>Informasi yang dapat membahayakan negara</li>\r\n	<li>Informasi yang berkaitan dengan kepentingan perlindungan usaha dari persaingan usaha tidak sehat</li>\r\n	<li>Informasi yang berkaitan dengan hak-hak pribadi</li>\r\n	<li>Informasi yang berkaitan dengan rahasia jabatan, dan</li>\r\n	<li>Informasi publik yang diminta belum dikuasai atau didokumentasikan.</li>\r\n</ol>\r\n\r\n<p><strong><a name=\"KewajibanBadanPublik\"></a>Kewajiban Badan Publik</strong></p>\r\n\r\n<p>Setiap badan publik wajib menyediakan, memberikan dan/atau menerbitkan informasi publik yang berada di bawah kewenangannya kepada pemohon informasi publik, kecuali informasi yang termasuk kategori &quot;dikecualikan&quot;. Informasi yang diberikan harus akurat, benar, dan tidak menyesatkan.</p>\r\n\r\n<p>Berkaitan dengan itu, setiap badan publik memiliki kewajiban melaksanakan kearsipan dan pendokumentasian berdasarkan peraturan perundang-undangan. Selain itu, setiap badan publik berkewajiban menyediakan dan mengumumkan informasi dalam tiga kategori berikut:</p>\r\n\r\n<ol>\r\n	<li>Informasi yang wajib disediakan dan diumumkan secara berkala</li>\r\n	<li>Informasi yang wajib diumumkan secara serta-merta, dan</li>\r\n	<li>Informasi yang wajib tersedia setiap saat.</li>\r\n</ol>\r\n\r\n<p>Informasi kategori pertama dan kedua harus disebarluaskan dengan cara yang mudah dijangkau oleh masyarakat dan dalam bahasa yang mudah dipahami.</p>\r\n\r\n<p>Informasi yang termasuk kategori &quot;wajib disediakan dan diumumkan secara berkala&quot; antara lain adalah informasi yang berkaitan dengan badan publik, informasi mengenai kegiatan dan kinerja badan publik, dan informasi mengenai laporan keuangan.</p>\r\n\r\n<p>Informasi yang termasuk kategori &quot;wajib diumumkan secara serta merta&quot; yaitu informasi yang dapat mengancam hajat hidup orang banyak dan ketertiban umum.</p>\r\n\r\n<p>Informasi yang termasuk kategori &quot;wajib tersedia setiap saat&quot; antara lain adalah daftar seluruh informasi publik yang berada di bawah penguasaan badan publik tertentu tidak termasuk informasi yang dikecualikan, hasil keputusan badan publik dan pertimbangannya, seluruh kebijakan yang ada berikut dokumen pendukungnya, rencana kerja proyek termasuk di dalamnya perkiraan pengeluaran tahunan badan publik, perjanjian badan publik dengan pihak ketiga, informasi dan kebijakan yang disampaikan pejabat publik dalam pertemuan yang terbuka untuk umum, prosedur kerja pegawai badan publik yang berkaitan dengan pelayanan masyarakat, dan laporan mengenai pelayanan akses informasi.</p>\r\n\r\n<p><strong><a name=\"PrinsipPengaturan\"></a>Prinsip Pengaturan</strong></p>\r\n\r\n<p>Prinsip pengaturan informasi publik adalah sebagai berikut:</p>\r\n\r\n<ol>\r\n	<li>Setiap informasi publik pada dasarnya bersifat terbuka dan dapat diakses</li>\r\n	<li>Informasi yang dikecualikan bersifat ketat dan terbatas</li>\r\n	<li>Setiap informasi harus dapat diperoleh secara cepat dan tepat waktu, biaya ringan, dan dengan cara yang mudah, dan</li>\r\n	<li>Informasi yang dikecualikan bersifat rahasia sesuai dengan undang-undang, kepatutan, dan kepentingan umum yang didasarkan pada pengujian menyangkut konsekuensi yang timbul apabila suatu informasi dibuka, dan setelah mempertimbangkan dengan seksama bahwa dengan menutup informasi tersebut dapat melindungi kepentingan publik yang lebih besar dari pada membukanya.</li>\r\n</ol>\r\n\r\n<p><strong><a name=\"Manfaat\"></a>Manfaat</strong></p>\r\n\r\n<p>Keterbukaan informasi publik memberikan keuntungan baik bagi masyarakat maupun badan publik. Keterbukaan atau transparansi memberikan peluang bagi masyarakat untuk meningkatkan peran serta mereka dalam penyelenggaraan negara, sedangkan bagi badan publik memberikan peluang untuk meningkatkan pengelolaan dan pelayanan informasi sebagai&nbsp;<em>good governance</em>.</p>\r\n\r\n<p>Keterbukaan Informasi Publik memberikan manfaat antara lain:</p>\r\n\r\n<ol>\r\n	<li>Adanya jaminan hak bagi setiap orang untuk mengetahui rencana, program, proses, alasan pengambilan suatu kebijakan publik termasuk yang terkait dengan hajat hidup orang banyak</li>\r\n	<li>Mendorong partisipasi masyarakat dalam proses pengambilan kebijakan publik dan pengelolaan badan publik yang baik</li>\r\n	<li>Mendorong penyelenggaraan negara yang baik, yaitu transparansi, efektifitas, efisiensi, dan akuntabel</li>\r\n	<li>Mengembangkan ilmu pengetahuan dan mencerdaskan kehidupan bangsa, dan</li>\r\n	<li>Meningkatkan kualitas pengelolaan dan pelayanan informasi di lingkungan badan publik untuk menghasilkan layanan informasi yang berkualitas.</li>\r\n</ol>', NULL, '2021-05-03 18:46:13', '2021-05-03 18:46:13', NULL);

